pub enum MathInstruction {
    PreciseSquareRoot {
        radicand: u64,
    },
    SquareRootU64 {
        radicand: u64,
    },
    SquareRootU128 {
        radicand: u128,
    },
    U64Multiply {
        multiplicand: u64,
        multiplier: u64,
    },
    U64Divide {
        dividend: u64,
        divisor: u64,
    },
    F32Multiply {
        multiplicand: f32,
        multiplier: f32,
    },
    F32Divide {
        dividend: f32,
        divisor: f32,
    },
    Noop,
}
